import Vue from 'vue';
import moment from 'moment';
import ModalWrapper from "@/components/ModalWrapper.vue";

export default Vue.extend({
    name: "AnalyticsPage",
    components: {
        ModalWrapper,
    },
    data() {
        return {
            time_range_input: '7 ngày gần đây',
        }
    },
    computed: {
        time_range() {
            return {
                start: moment().subtract(7, 'd').format(),
                end: moment().format(),
            }
        }
    }
});
